import React, { Component } from 'react'
import { clientProject } from '../../actions/projectAction.js'
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import Project from './Project';
import "../../Css/AsClient.css"

class AsClient extends Component {

    componentDidMount(){
        this.props.clientProject();
           
    }
     componentWillReceiveProps(nextProps){   
                this.setState({
                     clientProject: nextProps.project
                });
                
     }
 
    render() {
        const { clientProject } = this.props.clientProject; 
        let ProjectData;

        
              ProjectData = (
                           <div>
                            <Project project={clientProject}/>
                         </div>
         )
        
          
     

     
        return (
            <div>
                {ProjectData}
            </div>
        )
    }
}
AsClient.propTypes = {
  clientProject: PropTypes.func.isRequired,
};

const mapStateToProps = (state) => ({
  auth: state.auth,
  clientProject: state.clientProject
});
export default connect(mapStateToProps, {  clientProject })(AsClient);
